import React from "react";
import styled from "styled-components";

const Main = styled.main`
  width: 1001px;
`;
function List() {
  return (
    <Main>
      <section>
        <div className="left">
          <div className="title">공지사항</div>
          <div className="sub">
            김과장 컨설팅에서 알려드리는 새로운 소식들입니다.
          </div>
        </div>
        <div className="search"></div>
      </section>
    </Main>
  );
}

export default List;
